import styled from 'styled-components';

export const Whrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 30px 10%;
`;

export const NavMenu = styled.nav`
  ul {
  }

  li {
    font-weight: 500;
    font-size: 16px;
    color: #edf0f1;
    text-decoration: none;

    a {
    }
  }
`;
